if (document.getElementById("product-list")) {
  const container = document.getElementById("product-list");
  products.forEach(product => {
    const div = document.createElement("div");
    div.className = "product";
    div.innerHTML = `
      <img src="${product.img}" alt="${product.name}">
      <h3>${product.name}</h3>
      <p>$${product.price}</p>
      <button onclick="addToCart(${product.id})">Add to Cart</button>
    `;
    container.appendChild(div);
  });
}

function addToCart(id) {
  const product = products.find(p => p.id === id);
  let cart = JSON.parse(localStorage.getItem("cart")) || [];

  const existing = cart.find(item => item.id === id);
  if (existing) {
    existing.quantity += 1;
  } else {
    cart.push({ ...product, quantity: 1 });
  }

  localStorage.setItem("cart", JSON.stringify(cart));
  alert("Added to cart");
}

function renderCart() {
  const cart = JSON.parse(localStorage.getItem("cart")) || [];
  const container = document.getElementById("cart-items");
  container.innerHTML = "";

  let total = 0;

  if (cart.length === 0) {
    container.innerHTML = "<p>Your cart is empty.</p>";
    document.getElementById("total").textContent = "";
    return;
  }

  cart.forEach((item, index) => {
    const div = document.createElement("div");
    div.className = "product";
    const subtotal = item.price * item.quantity;
    total += subtotal;

    div.innerHTML = `
      <img src="${item.img}" alt="${item.name}">
      <h3>${item.name}</h3>
      <p>Price: $${item.price}</p>
      <div class="product-controls">
        <label>Qty:
          <input type="number" min="1" value="${item.quantity}" onchange="changeQuantity(${index}, this.value)">
        </label>
        <button class="remove-btn" onclick="removeFromCart(${index})">Remove</button>
      </div>
      <p>Subtotal: $${subtotal}</p>
    `;
    container.appendChild(div);
  });

  document.getElementById("total").textContent = `Total: $${total}`;
}

function removeFromCart(index) {
  let cart = JSON.parse(localStorage.getItem("cart")) || [];
  cart.splice(index, 1);
  localStorage.setItem("cart", JSON.stringify(cart));
  renderCart();
}

function changeQuantity(index, newQty) {
  let cart = JSON.parse(localStorage.getItem("cart")) || [];
  const qty = parseInt(newQty);
  if (qty >= 1) {
    cart[index].quantity = qty;
    localStorage.setItem("cart", JSON.stringify(cart));
    renderCart();
  }
}

function submitOrder(event) {
  event.preventDefault();
  const address = document.getElementById("address").value;
  const delivery = document.getElementById("delivery-option").value;
  let extra = delivery === "express" ? 10 : 0;

  let cart = JSON.parse(localStorage.getItem("cart")) || [];
  let total = cart.reduce((sum, item) => sum + item.price * item.quantity, 0) + extra;

  alert(`Order placed!\nDelivery: ${delivery}\nAddress: ${address}\nTotal: $${total}`);
  localStorage.removeItem("cart");
  window.location.href = "r.html";
}

if (document.getElementById("cart-items")) {
  renderCart();
}
